package com.silence.study.core.entity.album;import java.io.Serializable;import java.util.Date;import com.origin.eurybia.jdbc.annotation.Column;import com.origin.eurybia.jdbc.annotation.Validator;/** * <br> * <b>功能：</b>公司相册详情表 Entity<br> * <b>作者：</b>@author Silence<br> * <b>日期：</b>2018-05-12 00:55:52<br> * <b>详细说明：</b>无<br> */public class BusAlbumDetailEntity implements Serializable {		private static final long serialVersionUID = 1L;		/**	 * 图片详细ID	 */	@Column(name="album_detail_id")	private Integer albumDetailId;	/**	 * 图片地址	 */	@Validator(name="图片地址",len = 200)	@Column(name="picture_url")	private String pictureUrl;	/**	 * 相册ID	 */	@Column(name="album_id")	private Integer albumId;	/**	 * 创建时间	 */	@Validator(name="创建时间",notNull = true)	@Column(name="create_time")	private Date createTime;		public Integer getAlbumDetailId() {	    return this.albumDetailId;	}	public void setAlbumDetailId(Integer albumDetailId) {	    this.albumDetailId=albumDetailId;	}	public String getPictureUrl() {	    return this.pictureUrl;	}	public void setPictureUrl(String pictureUrl) {	    this.pictureUrl=pictureUrl;	}	public Integer getAlbumId() {	    return this.albumId;	}	public void setAlbumId(Integer albumId) {	    this.albumId=albumId;	}	public Date getCreateTime() {	    return this.createTime;	}	public void setCreateTime(Date createTime) {	    this.createTime=createTime;	}}